import React, { useEffect, useState } from "react";
import { Customer } from "./section/Customer";

// Styles
import "./app.scss";

// Components
import Header from "./components/Header";
import Footer from "./components/Footer";
import DataTable from "./components/DataTable";
import CreateUser from "./components/CreateCustomer";
import UpdateUser from "./components/UpdateCustomer";
import DeleteUser from "./components/DeleteCustomer";
import Modal from "./components/Modal";
import Search from "./components/Search";
import Pagination from "./components/Pagination";
import Loader from "./components/Loader";
import MySwal from "./index";

function App() {
  return (
    <div className="app">
      <Header />
      <Customer />
      <Footer />
    </div>
  );
}

export default App;
